import React from 'react';

const TaskPage = () => {
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const projectId = queryParams.get("projectId"); // ✅ URL에서 projectId 가져오기

  return (
    <div>
      <h1>Task Page</h1>
      {projectId ? <h2>프로젝트 ID: {projectId}</h2> : <p>선택된 프로젝트가 없습니다.</p>}
    </div>
  );
};

export default TaskPage;
